import Homepage from './components/Homepage';
import './App.css';
import ContactMe from './components/ContactMe';
import Certificate from './components/Certificate';
import Curriculum from './components/Curriculum';
import MyProjects from './components/MyProjects';
import Menu from './components/Menu';
import {Nav, Navbar, Container} from 'react-bootstrap';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return ( 
<div>
<Navbar class="navbar navbar-expand-lg bg-light">
<Container> 
  <div class="container-fluid nav-menu">
<Navbar.Brand id="home" href="home">Andrea Tricerri</Navbar.Brand>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav me-auto mb-5 mb-lg-0">
        <li class="nav-item">
        <Nav.Link id="myProjectPage" aria-current="page" href="myprojects">My Projects</Nav.Link>
        </li>
        <li class="nav-item">
          <Nav.Link class="nav-link active" id="certificatePage" aria-current="page" href="certificates">Certificates</Nav.Link>
        </li>
        <li class="nav-item">
          <Nav.Link class="nav-link active" id="cvPage" aria-current="page" href="cv">CV</Nav.Link>
        </li>
        <li class="nav-item">
          <Nav.Link class="nav-link active" id="contactMePage" aria-current="page" href="contactme">Contact Me</Nav.Link>
        </li>
      </ul>
    </div>
  </div>
  </Container>
  </Navbar>
</div>
); 
}
export default App;
